import { createMuiTheme } from "@material-ui/core/styles";

export const theme = createMuiTheme({
         palette: {
           secondary: {
             main: "#5f0937",
           },
         },

         typography: {
           h6: {
             fontWeight: 900,
             letterSpacing: "0.05em",
             fontSize: "1rem",
           },

           h5: {
             fontWeight: 900,
             letterSpacing: "0.05em",
             fontSize: "1rem",
           },
         },

         overrides: {
           MuiTypography: {
             gutterBottom: {
               gutterBottom: "false",
               marginBottom: "1em",
             },
           },
         },

         props: {
           MuiButton: {
             color: "secondary",
             variant: "contained",
             size: "small",
           },

           MuiTypography: {
             color: "seconadry",
           },

           MuiSvgIcon: {
             root: {
               fontSize: "1",
             },
           },
         },
       });
